import Container from "../components/container";

const About = () => {
  return (
    <Container>
      <h1>About</h1>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Iure voluptates
        odit consectetur quos, accusamus est, ipsam atque, rem eius eaque sint
        soluta illo? Obcaecati ea saepe natus in architecto id?
      </p>
    </Container>
  );
};

export default About;
